  [],\n\t\"revision_timestamp\": \"2016-07-05T01:10:17.647473\",\n\t\"name\": \"ghrsst-level-2p-global-subskin-sea-surface-temperature-from-the-advanced-microwave-scanning-rad\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Advanced Microwave Scanning Radiometer
  2 (AMSR2) was launched on 18 May 2012, onboard the Global Change Observation Mission
  - Water (GCOM-W) satellite developed by the Japan Aerospace Exploration Agency (JAXA).
  The GCOM-W mission aims to establish the global and long-term observation system
  to collect data, which is needed to understand mechanisms of climate and water cycle
  variations, and demonstrate its utilization. AMSR2 onboard the first generation
  of the GCOM-W satellite will continue Aqua/AMSR-E observations of water vapor, cloud
  liquid water, precipitation, SST, sea surface wind speed, sea ice concentration,
  snow depth, and soil moisture. AMSR2 is a remote sensing instrument for measuring
  weak microwave emission from the surface and the atmosphere of the Earth. From about
  700 km above the Earth, AMSR2 will provide us highly accurate measurements of the
  intensity of microwave emission and scattering. The antenna of AMSR2 rotates once
  per 1.5 seconds and obtains data over a 1450 km swath. This conical scan mechanism
  enables AMSR2 to acquire a set of daytime and nighttime data with more than 99%
  coverage of the Earth every 2 days. Remote Sensing Systems (RSS, or REMSS), providers
  of these SST data for the Group for High Resolution Sea Surface Temperature (GHRSST)
  Project, performs a detailed processing of AMSR2 instrument data in two stages.
  The first stage produces a near-real-time (NRT) product (identified by \"_rt_\"
  within the file name) which is made as available as soon as possible. This is generally
  within 3 hours of when the data are recorded. Although suitable for many timely
  uses the NRT products are not intended to be archive quality. \"Final\" data (currently
  identified by \"v7.2\" within the file name) are processed when RSS receives the
  atmospheric model National Center for Environmental Prediction (NCEP) Final Analysis
  (FNL) Operational Global Analysis. The NCEP wind directions are particularly useful
  for retrieving more accurate SSTs and wind speeds. This dataset adheres to the GHRSST
  Data Processing Specification (GDS) version 2 format specifications.\",\n\t\"license_title\":
